import React, { useState, useContext, useEffect } from "react";
import { Link } from "react-router-dom";
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import AccountCircleOutlinedIcon from '@mui/icons-material/AccountCircleOutlined';
import GradeOutlinedIcon from '@mui/icons-material/GradeOutlined';
import LocalMallOutlinedIcon from '@mui/icons-material/LocalMallOutlined';
import axios from "axios";
import logo from "../../images/CandyLand_Logo_Blue.png";
import "./Navbar.css";
import { CartContext } from "../../pages/Cart/CartProvider.jsx";
import Cart from "../../pages/Cart/Cart.jsx";

const Navbar = () => {
  const [open, setOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState("");
  const [productSuggestions, setProductSuggestions] = useState([]);
  const [selectedProduct, setSelectedProduct] = useState(null);
  const { getCartSize } = useContext(CartContext);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          `http://localhost:4000/api/products/search?searchQuery=${searchQuery}`
        );
        const products = response.data;
        setProductSuggestions(products);
      } catch (error) {
        console.error('Error searching for product:', error);
      }
    };

    if (searchQuery.trim() !== "") {
      fetchData();
    } else {
      setProductSuggestions([]);
    }
  }, [searchQuery]);

  const handleSearch = (e) => {
    e.preventDefault();
    if (selectedProduct) {
      // Perform the desired action when a product is selected
      console.log("Selected Product:", selectedProduct);
    } else {
      // Perform a different action when the search button is clicked without selecting a product
      console.log("Search Button Clicked");
    }
  };

  return (
    <div className="Navbar">
      <div className="wrapper">
        <div className="center">
          <Link className="link" to="/">
            <img className="logo" src={logo} alt="Candyland Logo" />
          </Link>
        </div>
        <div className="left"></div>
        <div className="item">
          <Link className="link" to="/products/CandyBar">
            Candy Bars
          </Link>
        </div>
        <div className="item">
          <Link className="link" to="/products/CandyCorn">
            Candy Corn
          </Link>
        </div>
        <div className="item">
          <Link className="link" to="/products/CandyStick">
            Candy Sticks
          </Link>
        </div>
        <div className="right">
          {/* Search Bar */}
          <div className="searchBar">
            <input
              className="searchInput"
              type="text"
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
              placeholder="What are you looking for?"
            />
            <div className="searchButton" onClick={handleSearch}>
              <SearchOutlinedIcon className="searchIcon" />
            </div>
            {productSuggestions.length > 0 && (
              <div className="dropDownMenu">
                {productSuggestions.map((item) => (
                  <div
                    key={item.id}
                    onClick={() => setSelectedProduct(item)}
                    className="dropDownRow"
                  >
                    {item.name}
                  </div>
                ))}
              </div>
            )}
          </div>
          <div className="item">
            <Link className="link" to="/">
              About
            </Link>
          </div>
          <div className="item">
            <Link className="link" to="/">
              Contact
            </Link>
          </div>
          <div className="icons">
            <Link className="link" to="/account">
              <AccountCircleOutlinedIcon />
            </Link>
            <Link className="link" to="/account/favorites">
              <GradeOutlinedIcon />
            </Link>
            <div className="cartIcon" onClick={() => setOpen(!open)}>
              <LocalMallOutlinedIcon />
              <span>{getCartSize()}</span>
            </div>
          </div>
        </div>
      </div>
      {open && <Cart />}
    </div>
  );
};

export default Navbar;
